func findPrimePairs(n int) [][]int {
    primes := sieveOfEratosthenes(n)
    var pairs [][]int
    for i := 2; i <= n/2; i++ {
        if primes[i] && primes[n-i] {
            pairs = append(pairs, []int{i, n - i})
        }
    }
    return pairs
}

func sieveOfEratosthenes(n int) []bool {
    prime := make([]bool, n+1)
    for i := 2; i <= n; i++ {
        prime[i] = true
    }
    for p := 2; p*p <= n; p++ {
        if prime[p] {
            for i := p * p; i <= n; i += p {
                prime[i] = false
            }
        }
    }
    return prime
}
